import React from 'react'
import Carousel from "./CarouselSlick"
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import carlton from "./../images/carlton.jpg"
import gastro from "./../images/gastropizza.jpeg"
import univ from "./../images/Université_d'Antananarivo.jpg"
import ambatobe from "./../images/le-triskel-un-etablissement.jpg"
import pietra from "./../images/gastro-pizza-analakely1.jpg"


const lesImages = [
  {image: carlton, titre: "lorem", paragraphe:"lorem lorem lorem lorem"},
  {image: gastro, titre: "lorem", paragraphe:"lorem lorem lorem lorem"},
  {image: univ, titre: "lorem", paragraphe:"lorem lorem lorem lorem"}
]
function Actualités() {
  return (
    <div id='Actualites'>
        <h1>Acualités</h1>
        <h3>pourq</h3>
        <Carousel 
        images={lesImages}/>
    </div>
  )
}

export default Actualités
